import React, { Component } from 'react';
import "./App.css";
import { connect, sendMsg } from './api';

import Header from './components/Header';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      chatHistory: []
    }
  }

  send() {
    console.log("hello");
    sendMsg("hello");
  }

  render() {
    return (
      <div className="App">
        <Header />
        <ChatHistory />
        <button onClick={this.send}>Hit</button>
      </div>
    );
  }
}

export default App;
